  return (
    <div>

      <ProfileImages />

      <IntroText />
      <Splitter />

      <NavigationTab />
      <Splitter />

      <ResumeBox />
      <Splitter />


      <HardSkills />
      <Splitter />

      <BackgroundExperience />
      <Splitter />

      <FeaturedWork />
      <Splitter />

      <Portafolio />
      <Splitter />


    </div>
  );
}

export default App;
